import React from "react";
import { Form, Button, Col } from "react-bootstrap";
function UpdateForm() {
  return (
    <>
      <h4> test</h4>

      <Form>
        <Form.Row>
          <Col>
            <Form.Control placeholder="update name"></Form.Control>
          </Col>
          <Col>
            <Form.Control placeholder="update lastname"></Form.Control>
          </Col>
          <Col>
            <Form.Control placeholder="update age"></Form.Control>
          </Col>
          <Col>
            <Button>update</Button>
          </Col>
        </Form.Row>
      </Form>
    </>
  );
}

export default UpdateForm;
